  { path: 'users', component: PessoasComponent },
  { path: 'users/:id', component: UserDtComponent },
  { path: '**', component: Error404Component }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule],
})
export class AppRoutingModule {}

